import React from 'react';
import './Home.css';
import fone from './backgr.png';

function Home() {
	return (
		<div className='home'>
			<div className='home_container'>
				<img className='home_image' src={fone} alt="" />;
			</div>
		</div>
	);
}

export default Home;
